
"""
# Shortest Path in Binary Matrix

Given an `n x n` binary matrix `grid`, return *the length of the shortest clear path in the matrix*. If there is no clear path, return `-1`.

A **clear path** in a binary matrix is a path from the top-left cell (i.e., `(0, 0)`) to the **bottom-right** cell (i.e., `(n - 1, n - 1)`) such that:
    -All the visited cells of the path are `0`.
    - All the adjacent cells of the path are **8-directionally** connected (i.e., they are different and they share an edge or a corner).

The **length of a clear path** is the number of visited cells of this path.


**Example 1:** 
![1091_example1_1](./img/1091_example1_1.png)
```
Input: grid = [[0,1],[1,0]]
Output: 2
```

**Example 2:** 
![1091_example2_1](./img/1091_example2_1.png)
```
Input: grid = [[0,0,0],[1,1,0],[1,1,0]]
Output: 4
```

**Example 3:** 
```
Input: grid = [[1,0,0],[1,1,0],[1,1,0]]
Output: -1
```

**Constraints:** 
    - `n == grid.length` 
    - `n == grid[i].length` 
    - `1 <= n <= 100` 
    - `grid[i][j] is 0 or 1` 
"""

from typing import List
from itertools import product

class Solution:
    def shortestPathBinaryMatrix(self, grid: List[List[int]]) -> int:
        n, queue = len(grid), []
        if grid[0][0] == 0:
            queue += [(0, 0, 1)]
            grid[0][0] -= 1
        while queue:
            x, y, dist = queue.pop(0)
            if x == n - 1 and y == n - 1:
                return dist
            for dx, dy in product(range(-1, 2), range(-1, 2)):
                if 0 <= x + dx < n and 0 <= y + dy < n and grid[x + dx][y + dy] == 0:
                    queue += [(x + dx, y + dy, dist + 1)]
                    grid[x + dx][y + dy] -= 1
        return -1

# 2
print(Solution().shortestPathBinaryMatrix([
    [0, 1], 
    [1, 0]
]))

# 4
print(Solution().shortestPathBinaryMatrix([
    [0, 0, 0], 
    [1, 1, 0], 
    [1, 1, 0]
]))

# -1
print(Solution().shortestPathBinaryMatrix([
    [0, 0, 0], 
    [1, 1, 0], 
    [1, 1, 1]
]))

